import React from "react";
import Mix from "../Mix";

const MixContainer = ({ mixes }) => (
  <div>
    <h4>mix container</h4>

    {mixes.map((mix) => (
      <Mix mix={mix} />
    ))}
  </div>
);

export default MixContainer;
